import { OpenDirOptions } from "fs";
import { ChangeEvent } from "react";

type addHabitProps = {
  handleChange: (event: ChangeEvent<HTMLInputElement>) => void,
  handleSubmit: (event: ChangeEvent) => void,
  value: string
}

export const AddHabit = ({handleChange, handleSubmit, value}: addHabitProps) => {
  return (
    <form>
        <input type="text" id="New Habit" onChange={() => handleChange} value={value}/>
        <input type="button" id="Submit Habit" value="Add Habit" onClick={() => handleSubmit}/>
    </form>
  )
}
